import React, { useEffect, useState } from 'react';
import { getAdminUsers, createAdminUser, updateAdminUser, deleteAdminUser } from '../api';
import AdminUsers from '../components/AdminUsers';

const AdminUsersPage = () => {
    const [adminUsers, setAdminUsers] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchAdminUsers = async () => {
            try {
                const users = await getAdminUsers();
                setAdminUsers(users);
            } catch (err) {
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        fetchAdminUsers();
    }, []);

    const handleCreate = async (newUser) => {
        try {
            const createdUser = await createAdminUser(newUser);
            setAdminUsers([...adminUsers, createdUser]);
        } catch (err) {
            setError(err.message);
        }
    };

    const handleUpdate = async (updatedUser) => {
        try {
            const user = await updateAdminUser(updatedUser);
            setAdminUsers(adminUsers.map((u) => (u.id === user.id ? user : u)));
        } catch (err) {
            setError(err.message);
        }
    };

    const handleDelete = async (userId) => {
        try {
            await deleteAdminUser(userId);
            setAdminUsers(adminUsers.filter((user) => user.id !== userId));
        } catch (err) {
            setError(err.message);
        }
    };

    if (loading) return <div>Loading...</div>;
    if (error) return <div>Error: {error}</div>;

    return (
        <div>
            <h1>Admin Users</h1>
            <AdminUsers 
                adminUsers={adminUsers} 
                onCreate={handleCreate} 
                onUpdate={handleUpdate} 
                onDelete={handleDelete} 
            />
        </div>
    );
};

export default AdminUsersPage;
